import React from 'react';
import { Link } from 'react-router-dom';

const MemeCard = ({ meme }) => {
    return (
        <Link to={`/meme/${meme.id}`} onClick={() => setMeme(meme)}>
        <div className='imgWrapper'>
            <img src={meme.url} alt={meme.name} />
        </div>
        <div className='memeName'>
            <h4>{meme.name}</h4>
        </div>
        </Link>
    );
  };

  export default MemeCard;





